// https://www.youtube.com/watch?v=GGkBwpxV7AI
import React from 'react';
import styled from 'styled-components'

const Nav = styled.nav`
width : 100%;
height: 65px;
border-bottom: 2px solid black;
padding: 0 20px
list-style: none;
`

const NavBar = () => {
    return (
        <div>
         <Nav>
             <div>LOGO</div>
             <ul>
             <li>Home</li>
             <li>Skills</li>
             <li>Background</li>
             <li>Contact</li>
             </ul>
         </Nav>
</div>
    )
}

export default NavBar
